import React from 'react';
import PropTypes from 'prop-types';
import { makeStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import Typography from '@material-ui/core/Typography';
import Box from '@material-ui/core/Box';
import Container from '@material-ui/core/Container';
import Button from '@material-ui/core/Button';
import Card from '@material-ui/core/Card';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';




export default class HomePage extends React.Component {
   state={
       page:0
   }

switcher = (e,newVal) => {
    this.setState({page:newVal})
    console.log(e.target,newVal)
}
//amar way te kaj hocce but eta deprecated 
// tui direct documentation er ta follow kor
// framework er sathe updatea thaka tough 
//bar bar update hoy 
// okhane oder kisu default atrbute ase jemon aria-lebeledy..emon
//bujsos ?konta follow krtham?...docuemtnation ohhhh. wait
    render() {
        return (

            <div className="HomePage">
                <Card className="card">
                    <div className="content">
                        <h2>Build Your Droplet</h2>
                        
                        <Tabs className="tabs" onChange={this.switcher} value={0}>
                            <Tab label="Standard" id={0} aria-controls="sd"  />
                            <Tab label="General Purpose" />
                            <Tab label="Cpu optimized" />
                            <Tab label="memory optimized" />
                        </Tabs>
                        {this.state.page === 0 && <div value={0}>
                            one
                        </div>}
                        {this.state.page === 1 && <div>
                            tow
                        </div>}
                        {this.state.page === 2 && <div>
                            three
                        </div>}
                    </div>
                </Card>
            </div>
        )
    }
}
